import React, { Component } from 'react';
import On from './on.png';
import Off from './off.png';
import Open from './open.svg';
import Close from './close.svg';
export default class k316 extends Component {
    render() {
        var k1 = On, k2 = Open, k3 = Open;
        function status(d, w, l) {
            if (d == 1) {
                k1 = Open;
            } else {
                k1 = Close;
            }
            if (w == 1) {
                k2 = Open;
            } else {
                k2 = Close;
            }
            if (l == 1) {
                k3 = On;
            } else {
                k3 = Off;
            }
            return k1, k2, k3;
        }

        status(0, 0, 1);
        return (
            <div>
                <div className="fon">
                    <div className="number">316</div>
                    <h1 className="door">Двери:</h1>
                    <h1 className="window">Окна:</h1>
                    <h1 className="light">Свет:</h1>

                    <h1 className="statusDoor">
                        <img
                            src={k1}
                        />
                    </h1>
                    <h1 className="statusWindow">
                        <img
                            src={k2}
                        />
                    </h1>
                    <h1 className="statusLight">
                        <img
                            src={k3}
                        />
                    </h1>
                </div>
            </div>
        );
    }
}
